import React from 'react';
import classes from './dialogs.module.css';
import {NavLink} from "react-router-dom";

let dialogsData = [
  { id: 1, name: "Natalya" },
  { id: 2, name: "Rudick" },
  { id: 3, name: "Denis" },
  { id: 4, name: "David" },
  { id: 5, name: "Rojer" },
  { id: 6, name: "Max" }
];

let messagesData = [
  {id:1, message:'Yo!'},
  {id:2, message:'Hello my friend'},
  {id:3, message:'How are you?'},
  {id:4, message:'I am Ok'}
];

const DialogsItem = (props) => {
    let path = "/dialogs/" + props.id; 
    return (
      <div className={classes.dialog}>
        <NavLink to={path}>{props.name}</NavLink>
      </div>
    );
}

const Message = (props) => {
    return (
        <div className={classes.message}>
            {props.message}
        </div>
    )
}

const Dialogs = (props) => {
    return (
      <div className={classes.wrapper}>
        <div className={classes.dialogsItems}>
          <DialogsItem id={dialogsData[0].id} name={dialogsData[0].name} />
          <DialogsItem id={dialogsData[1].id} name={dialogsData[1].name} />
          <DialogsItem id={dialogsData[2].id} name={dialogsData[2].name} />
          <DialogsItem id={dialogsData[3].id} name={dialogsData[3].name} />
          <DialogsItem id={dialogsData[4].id} name={dialogsData[4].name} />
          <DialogsItem id={dialogsData[5].id} nama={dialogsData[5].name} />
        </div>
        <div className={classes.messages}>
          <Message message={messagesData[0].message} />
          <Message message={messagesData[1].message} />
          <Message message={messagesData[2].message} />
          <Message message={messagesData[3].message} />
        </div>
      </div>
    );
}
export default Dialogs;
